import React, {Component} from 'react';

class MyComponent extends Component{

    render(){
     let receta = {
         name : 'pizza',
         ingredientes:['tomate ,queso,chorizo'],
         calorias : 400
     };


        return (
            <React.Fragment>
            <h1>{receta.name}</h1>
        <h2>{receta.ingredientes}</h2>
        <h3>{receta.calorias}</h3>
            <hr/>
            </React.Fragment>
        );
    }

}

export default MyComponent;
